impleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"nErmW89_hr0\",\"title\":\"Babies Behind Bars - Part 1\",\"lengthSeconds\":\"2729\",\"keywords\":[\"babies\",\"behind\",\"bars\",\"prison\",\"locked\",\"up\",\"banged\",\"jail\",\"pregnancy\",\"pregnant\",\"prego\",\"preggo\",\"preggers\",\"knocked\",\"baby\",\"big\",\"huge\",\"swollen\",\"belly\",\"tummy\",\"fat\",\"young\",\"girl\",\"women\",\"born\",\"birth\",\"labour\"],\"channelId\":\"UCWQVkb20Cf51A8Qvopjnssg\",\"isOwnerViewing\":false,\"shortDescription\":\"Part 1 of a 2 part documentary\\n\\nHaving a baby in prison is no picnic. Every year thousands of babies are born in American prisons. Many of them are taken away from their mothers at birth or soon after. These powerful, moving, shocking and insightful films follow the dramatic and emotional stories of a group of pregnant inmates at the Indiana Women’s Prison. Featuring births, babies and a lot of tears this film uses powerful personal stories to pose poignant questions about how the criminal justice deals with women and children. Challenging preconceptions they make the viewer see prisoners in a new light as mothers and human beings. Can the bond between mother and child survive the harsh realities of life behind bars?\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/nErmW89_hr0\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLARXbZwWxPIW8
